import React from 'react';
import ReturnAcTif from './Actif';
import HmDash from '../Hm/Main';
import BarLoader from 'react-spinners/BarLoader';
import { useNavigate } from 'react-router-dom';

// Return Actif
export default function ActiF() {

 const navigation = useNavigate();
 const [loading, setLoading] = React.useState(true);
 const [useR, setUseR] = React.useState(null);

 React.useEffect(() => {

  const data = window.localStorage.getItem('ACTIVE');
  setUseR(JSON.parse(data));

  window.setTimeout(() => {
   setLoading(false);
  }, 7600);

  window.setTimeout(() => {
   JSON.parse(data) !== true && navigation('/');
  }, 9894);

 }, []);

 return (
  <div>
   {loading && <div className='App-loading-Actif'></div>}
   {loading && <div className='App-Icon'>
    <BarLoader
     size={15}
     color={'#00b8d4'}
     loading={loading}
    />
   </div>}

   <>
    {useR ? <ReturnAcTif /> : <HmDash />}
   </>
  </div>
 );
};
